import {BsFillMoonStarsFill} from 'react-icons/bs';

function App() {

  //return starts here
  return (
    <div className="App">
      <section className=" h-screen">
        <nav className='py-10 mb-12 flex justify-between'>
          <h1>Mambwe</h1>
          <ul>
            <li>
              <BsFillMoonStarsFill/>
            </li>
